import { ethers } from "ethers";
import contractAbi from "./abisTicketSale.json"; // ABI dari kontrak TicketSale

const contractAddress = "0x5FbDB2315678afecb367f032d93F642f64180aa3"; // Alamat kontrak yang sudah di-deploy
const provider = new ethers.providers.Web3Provider(window.ethereum);
const signer = provider.getSigner();

export { contractAddress, contractAbi };
